import React from 'react';

import shopData from '../../shop-data.json';

function Shop() {
    return (
        <div>
            {
                shopData.map(({id, name}) => {
                    <div>
                        <h2 key={id}>{name}</h2>
                    </div>
                })
            }
        </div>
    )
}

export default Shop
